import React, { Component } from 'react';

import Header from '../components/Header'

class index extends Component {

  render() {
    return (
      <div>
        <Header/>
        <section class="bg-dark">
          <div className="container">
              <div class="jumbotron bg-dark">
                <h1 class="display-4 text-info">Real Estate Meets:</h1>
                <div className="container d-flex align-item-start justify-content-center bg-warning">
                  <i class="fas fa-brain fa-7x mt-5"></i>
                  <i class="fas fa-vr-cardboard fa-7x mt-5"></i>
                </div>
              </div>
            </div>
        </section>
        <style>{`
          img {
            opacity: 0.7;
            background-size: cover;
            display: block;
          }

          h1 {
            font-family: lato;
          }

          i {
            color: white;
          }

        `}</style>
      </div>
    );
  }
}

export default index;
